import React from "react";
import Projects from "./projects.json";

class PortfolioItem extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      projects: <Projects />
    };
  }

  render() {
    return <></>;
  }
}

export default PortfolioItem;
